// import React from "react";
import Link from "next/Link";

export default function NavBar() {
  const styles = {
    display: "flex",
    backgroundColor: "cobalt",
    alignItems: "space-between",
    color: "grey",
  };
  return (
    <div style={styles}>
      <Link href="/">
        <a>Index</a>
      </Link>
      <Link href="/contact">
        <a>Contact</a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>
    </div>
  );
}
